import React from 'react';
import { Text, View, ScrollView, TextInput, image } from 'react-native';
import { getPooledFromElement } from 'react-native/Libraries/Components/Touchable/BoundingDimensions';



const Cat = () => {
  return (
    <SafeAreaView style={styles.container}>
    <View>
    <View style={styles.fixToText}>
        <Button
          title="Left button"
          onPress={() => Alert.alert('Left button pressed')}
        />
        <Button
          title="Right button"
          onPress={() => Alert.alert('Right button pressed')}
        />
      </View>
    </View>
  </SafeAreaView>
);

}



const MeuApp = () => {
  return (
    <ScrollView>
      <Cat />
      <Text>
        SOME TEXT
      </Text>
      <View>
        <Text>
          Some more text
        </Text>

      </View>

      <TextInput
        style={{
          height: 40,
          borderEndColor: 'gray',
          borderWidth: 1,
          margin: 49,
          textAlign: 'center',
          borderRadius: 8,
          borderColor: 'ff0000'
        }}

        defaultValue="you can type in me"
      />
    </ScrollView>

  );
} 



export default MeuApp; Cat;
